@testset "5.6.1 u (a+b arccsc(c x))^n" begin
    @variables a, b, c, d, e, f, m, x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*u*(a+b*acsc(c*x))^n=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(d*x)^m*(a+b*acsc(c*x))^n=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(a+b*acsc(c*x))^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [x^6*(a + b*acsc(c*x)), x, 7, (5*b*sqrt(1 - 1/(c^2*x^2))*x^2)/(112*c^5) + (5*b*sqrt(1 - 1/(c^2*x^2))*x^4)/(168*c^3) + (b*sqrt(1 - 1/(c^2*x^2))*x^6)/(42*c) + (x^7*(a + b*acsc(c*x)))/7 + (5*b*atanh(sqrt(1 - 1/(c^2*x^2))))/(112*c^7)]
    @test_int [x^5*(a + b*acsc(c*x)), x, 4, (4*b*sqrt(1 - 1/(c^2*x^2))*x)/(45*c^5) + (2*b*sqrt(1 - 1/(c^2*x^2))*x^3)/(45*c^3) + (b*sqrt(1 - 1/(c^2*x^2))*x^5)/(30*c) + (x^6*(a + b*acsc(c*x)))/6]
    @test_int [x^4*(a + b*acsc(c*x)), x, 6, (3*b*sqrt(1 - 1/(c^2*x^2))*x^2)/(40*c^3) + (b*sqrt(1 - 1/(c^2*x^2))*x^4)/(20*c) + (x^5*(a + b*acsc(c*x)))/5 + (3*b*atanh(sqrt(1 - 1/(c^2*x^2))))/(40*c^5)]
    @test_int [x^3*(a + b*acsc(c*x)), x, 3, (b*sqrt(1 - 1/(c^2*x^2))*x)/(6*c^3) + (b*sqrt(1 - 1/(c^2*x^2))*x^3)/(12*c) + (x^4*(a + b*acsc(c*x)))/4]
    @test_int [x^2*(a + b*acsc(c*x)), x, 5, (b*sqrt(1 - 1/(c^2*x^2))*x^2)/(6*c) + (x^3*(a + b*acsc(c*x)))/3 + (b*atanh(sqrt(1 - 1/(c^2*x^2))))/(6*c^3)]
    @test_int [x*(a + b*acsc(c*x)), x, 2, (b*sqrt(1 - 1/(c^2*x^2))*x)/(2*c) + (x^2*(a + b*acsc(c*x)))/2]
    @test_int [a + b*acsc(c*x), x, 5, a*x + b*x*acsc(c*x) + (b*atanh(sqrt(1 - 1/(c^2*x^2))))/c]
    @test_int [(a + b*acsc(c*x))/x, x, 6, ((im/2)*(a + b*acsc(c*x))^2)/b - (a + b*acsc(c*x))*log(1 - ℯ^((2*im)*acsc(c*x))) + (im/2)*b*PolyLog(2, ℯ^((2*im)*acsc(c*x)))]
    @test_int [(a + b*acsc(c*x))/x^2, x, 2, -(b*c*sqrt(1 - 1/(c^2*x^2))) - (a + b*acsc(c*x))/x]
    @test_int [(a + b*acsc(c*x))/x^3, x, 4, -(b*c*sqrt(1 - 1/(c^2*x^2)))/(4*x) + (b*c^2*acsc(c*x))/4 - (a + b*acsc(c*x))/(2*x^2)]
    @test_int [(a + b*acsc(c*x))/x^4, x, 4, -(b*c^3*sqrt(1 - 1/(c^2*x^2)))/3 + (b*c^3*(1 - 1/(c^2*x^2))^(3/2))/9 - (a + b*acsc(c*x))/(3*x^3)]
    @test_int [(a + b*acsc(c*x))/x^5, x, 5, -(b*c*sqrt(1 - 1/(c^2*x^2)))/(16*x^3) - (3*b*c^3*sqrt(1 - 1/(c^2*x^2)))/(32*x) + (3*b*c^4*acsc(c*x))/32 - (a + b*acsc(c*x))/(4*x^4)]
    @test_int [(a + b*acsc(c*x))/x^6, x, 4, -(b*c^5*sqrt(1 - 1/(c^2*x^2)))/5 + (2*b*c^5*(1 - 1/(c^2*x^2))^(3/2))/15 - (b*c^5*(1 - 1/(c^2*x^2))^(5/2))/25 - (a + b*acsc(c*x))/(5*x^5)]
    @test_int [(a + b*acsc(c*x))/x^7, x, 6, -(b*c*sqrt(1 - 1/(c^2*x^2)))/(36*x^5) - (5*b*c^3*sqrt(1 - 1/(c^2*x^2)))/(144*x^3) - (5*b*c^5*sqrt(1 - 1/(c^2*x^2)))/(96*x) + (5*b*c^6*acsc(c*x))/96 - (a + b*acsc(c*x))/(6*x^6)]


    @test_int [x^3*(a + b*acsc(c*x))^2, x, 5, (b^2*x^2)/(12*c^2) + (b*sqrt(1 - 1/(c^2*x^2))*x*(a + b*acsc(c*x)))/(3*c^3) + (b*sqrt(1 - 1/(c^2*x^2))*x^3*(a + b*acsc(c*x)))/(6*c) + (x^4*(a + b*acsc(c*x))^2)/4 + (b^2*log(x))/(3*c^4)]
    @test_int [x^2*(a + b*acsc(c*x))^2, x, 8, (b^2*x)/(3*c^2) + (b*sqrt(1 - 1/(c^2*x^2))*x^2*(a + b*acsc(c*x)))/(3*c) + (x^3*(a + b*acsc(c*x))^2)/3 + (2*b*(a + b*acsc(c*x))*atanh(ℯ^(im*acsc(c*x))))/(3*c^3) - ((im/3)*b^2*PolyLog(2, -ℯ^(im*acsc(c*x))))/c^3 + ((im/3)*b^2*PolyLog(2, ℯ^(im*acsc(c*x))))/c^3]
    @test_int [x*(a + b*acsc(c*x))^2, x, 4, (b*sqrt(1 - 1/(c^2*x^2))*x*(a + b*acsc(c*x)))/c + (x^2*(a + b*acsc(c*x))^2)/2 + (b^2*log(x))/c^2]
    @test_int [(a + b*acsc(c*x))^2, x, 7, x*(a + b*acsc(c*x))^2 + (4*b*(a + b*acsc(c*x))*atanh(ℯ^(im*acsc(c*x))))/c - ((2*im)*b^2*PolyLog(2, -ℯ^(im*acsc(c*x))))/c + ((2*im)*b^2*PolyLog(2, ℯ^(im*acsc(c*x))))/c]
    @test_int [(a + b*acsc(c*x))^2/x, x, 6, ((im/3)*(a + b*acsc(c*x))^3)/b - (a + b*acsc(c*x))^2*log(1 - ℯ^((2*im)*acsc(c*x))) + im*b*(a + b*acsc(c*x))*PolyLog(2, ℯ^((2*im)*acsc(c*x))) - (b^2*PolyLog(3, ℯ^((2*im)*acsc(c*x))))/2]
    @test_int [(a + b*acsc(c*x))^2/x^2, x, 4, (2*b^2)/x - 2*b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*acsc(c*x)) - (a + b*acsc(c*x))^2/x]
    @test_int [(a + b*acsc(c*x))^2/x^3, x, 4, b^2/(4*x^2) + (a*b*c^2*acsc(c*x))/2 + (b^2*c^2*acsc(c*x)^2)/4 - (b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*acsc(c*x)))/(2*x) - (a + b*acsc(c*x))^2/(2*x^2)]
    @test_int [(a + b*acsc(c*x))^2/x^4, x, 5, (2*b^2)/(27*x^3) + (4*b^2*c^2)/(9*x) - (4*b*c^3*sqrt(1 - 1/(c^2*x^2))*(a + b*acsc(c*x)))/9 - (2*b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*acsc(c*x)))/(9*x^2) - (a + b*acsc(c*x))^2/(3*x^3)]
    @test_int [(a + b*acsc(c*x))^2/x^5, x, 5, b^2/(32*x^4) + (3*b^2*c^2)/(32*x^2) + (3*a*b*c^4*acsc(c*x))/16 + (3*b^2*c^4*acsc(c*x)^2)/32 - (b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*acsc(c*x)))/(8*x^3) - (3*b*c^3*sqrt(1 - 1/(c^2*x^2))*(a + b*acsc(c*x)))/(16*x) - (a + b*acsc(c*x))^2/(4*x^4)]


    @test_int [x^3*(a + b*acsc(c*x))^3, x, 10, (b^3*sqrt(1 - 1/(c^2*x^2))*x)/(4*c^3) + (b^2*x^2*(a + b*acsc(c*x)))/(4*c^2) + ((im/2)*b*(a + b*acsc(c*x))^2)/c^4 + (b*sqrt(1 - 1/(c^2*x^2))*x*(a + b*acsc(c*x))^2)/(2*c^3) + (b*sqrt(1 - 1/(c^2*x^2))*x^3*(a + b*acsc(c*x))^2)/(4*c) + (x^4*(a + b*acsc(c*x))^3)/4 - (b^2*(a + b*acsc(c*x))*log(1 - ℯ^((2*im)*acsc(c*x))))/c^4 + ((im/2)*b^3*PolyLog(2, ℯ^((2*im)*acsc(c*x))))/c^4]
    @test_int [x^2*(a + b*acsc(c*x))^3, x, 11, (b^2*x*(a + b*acsc(c*x)))/c^2 + (b*sqrt(1 - 1/(c^2*x^2))*x^2*(a + b*acsc(c*x))^2)/(2*c) + (x^3*(a + b*acsc(c*x))^3)/3 + (b*(a + b*acsc(c*x))^2*atanh(ℯ^(im*acsc(c*x))))/c^3 + (b^3*atanh(sqrt(1 - 1/(c^2*x^2))))/c^3 - (im*b^2*(a + b*acsc(c*x))*PolyLog(2, -ℯ^(im*acsc(c*x))))/c^3 + (im*b^2*(a + b*acsc(c*x))*PolyLog(2, ℯ^(im*acsc(c*x))))/c^3 + (b^3*PolyLog(3, -ℯ^(im*acsc(c*x))))/c^3 - (b^3*PolyLog(3, ℯ^(im*acsc(c*x))))/c^3]
    @test_int [x*(a + b*acsc(c*x))^3, x, 7, (((3*im)/2)*b*(a + b*acsc(c*x))^2)/c^2 + (3*b*sqrt(1 - 1/(c^2*x^2))*x*(a + b*acsc(c*x))^2)/(2*c) + (x^2*(a + b*acsc(c*x))^3)/2 - (3*b^2*(a + b*acsc(c*x))*log(1 - ℯ^((2*im)*acsc(c*x))))/c^2 + (((3*im)/2)*b^3*PolyLog(2, ℯ^((2*im)*acsc(c*x))))/c^2]
    @test_int [(a + b*acsc(c*x))^3, x, 9, x*(a + b*acsc(c*x))^3 + (6*b*(a + b*acsc(c*x))^2*atanh(ℯ^(im*acsc(c*x))))/c - ((6*im)*b^2*(a + b*acsc(c*x))*PolyLog(2, -ℯ^(im*acsc(c*x))))/c + ((6*im)*b^2*(a + b*acsc(c*x))*PolyLog(2, ℯ^(im*acsc(c*x))))/c + (6*b^3*PolyLog(3, -ℯ^(im*acsc(c*x))))/c - (6*b^3*PolyLog(3, ℯ^(im*acsc(c*x))))/c]
    @test_int [(a + b*acsc(c*x))^3/x, x, 7, ((im/4)*(a + b*acsc(c*x))^4)/b - (a + b*acsc(c*x))^3*log(1 - ℯ^((2*im)*acsc(c*x))) + ((3*im)/2)*b*(a + b*acsc(c*x))^2*PolyLog(2, ℯ^((2*im)*acsc(c*x))) - (3*b^2*(a + b*acsc(c*x))*PolyLog(3, ℯ^((2*im)*acsc(c*x))))/2 - ((3*im)/4)*b^3*PolyLog(4, ℯ^((2*im)*acsc(c*x)))]
    @test_int [(a + b*acsc(c*x))^3/x^2, x, 5, 6*b^3*c*sqrt(1 - 1/(c^2*x^2)) + (6*b^2*(a + b*acsc(c*x)))/x - 3*b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*acsc(c*x))^2 - (a + b*acsc(c*x))^3/x]
    @test_int [(a + b*acsc(c*x))^3/x^3, x, 6, (3*b^3*c*sqrt(1 - 1/(c^2*x^2)))/(8*x) - (3*b^3*c^2*acsc(c*x))/8 + (3*b^2*(a + b*acsc(c*x)))/(4*x^2) - (3*b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*acsc(c*x))^2)/(4*x) + (c^2*(a + b*acsc(c*x))^3)/4 - (a + b*acsc(c*x))^3/(2*x^2)]
    @test_int [(a + b*acsc(c*x))^3/x^4, x, 8, (14*b^3*c^3*sqrt(1 - 1/(c^2*x^2)))/9 - (2*b^3*c^3*(1 - 1/(c^2*x^2))^(3/2))/27 + (2*b^2*(a + b*acsc(c*x)))/(9*x^3) + (4*b^2*c^2*(a + b*acsc(c*x)))/(3*x) - (2*b*c^3*sqrt(1 - 1/(c^2*x^2))*(a + b*acsc(c*x))^2)/3 - (b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*acsc(c*x))^2)/(3*x^2) - (a + b*acsc(c*x))^3/(3*x^3)]
    @test_int [(a + b*acsc(c*x))^3/x^5, x, 10, (3*b^3*c*sqrt(1 - 1/(c^2*x^2)))/(128*x^3) + (45*b^3*c^3*sqrt(1 - 1/(c^2*x^2)))/(256*x) - (45*b^3*c^4*acsc(c*x))/256 + (3*b^2*(a + b*acsc(c*x)))/(32*x^4) + (9*b^2*c^2*(a + b*acsc(c*x)))/(32*x^2) - (3*b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*acsc(c*x))^2)/(16*x^3) - (9*b*c^3*sqrt(1 - 1/(c^2*x^2))*(a + b*acsc(c*x))^2)/(32*x) + (3*c^4*(a + b*acsc(c*x))^3)/32 - (a + b*acsc(c*x))^3/(4*x^4)]


    #= ::Subsubsection::Closed:: =#
    #=n<0=#


    @test_int [x^1/(a + b*acsc(c*x)), x, 0, Unintegrable(x/(a + b*acsc(c*x)), x)]
    @test_int [x^0/(a + b*acsc(c*x)), x, 0, Unintegrable((a + b*acsc(c*x))^(-1), x)]
    @test_int [1/(x^1*(a + b*acsc(c*x))), x, 0, Unintegrable(1/(x*(a + b*acsc(c*x))), x)]
    @test_int [1/(x^2*(a + b*acsc(c*x))), x, 4, -((c*cos(a/b)*CosIntegral(a/b + acsc(c*x)))/b) - (c*sin(a/b)*SinIntegral(a/b + acsc(c*x)))/b]
    @test_int [1/(x^3*(a + b*acsc(c*x))), x, 6, (c^2*CosIntegral((2*a)/b + 2*acsc(c*x))*sin((2*a)/b))/(2*b) - (c^2*cos((2*a)/b)*SinIntegral((2*a)/b + 2*acsc(c*x)))/(2*b)]
    @test_int [1/(x^4*(a + b*acsc(c*x))), x, 9, -((c^3*cos(a/b)*CosIntegral(a/b + acsc(c*x)))/(4*b)) + (c^3*cos((3*a)/b)*CosIntegral((3*a)/b + 3*acsc(c*x)))/(4*b) - (c^3*sin(a/b)*SinIntegral(a/b + acsc(c*x)))/(4*b) + (c^3*sin((3*a)/b)*SinIntegral((3*a)/b + 3*acsc(c*x)))/(4*b)]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(d*x)^m*(a+b*acsc(c*x))^n*with*m*symbolic=#


    @test_int [(d*x)^m*(a + b*acsc(c*x))^3, x, 0, Unintegrable((d*x)^m*(a + b*acsc(c*x))^3, x)]
    @test_int [(d*x)^m*(a + b*acsc(c*x))^2, x, 0, Unintegrable((d*x)^m*(a + b*acsc(c*x))^2, x)]
    @test_int [(d*x)^m*(a + b*acsc(c*x)), x, 3, ((d*x)^(1 + m)*(a + b*acsc(c*x)))/(d*(1 + m)) + (b*(d*x)^m*Hypergeometric2F1(1/2, -m/2, 1 - m/2, 1/(c^2*x^2)))/(c*m*(1 + m))]
    @test_int [(d*x)^m/(a + b*acsc(c*x)), x, 0, Unintegrable((d*x)^m/(a + b*acsc(c*x)), x)]
    @test_int [(d*x)^m/(a + b*acsc(c*x))^2, x, 0, Unintegrable((d*x)^m/(a + b*acsc(c*x))^2, x)]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(f*x)^m*(d+e*x)^m*(a+b*acsc(c*x))^n=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(d+e*x)^m*(a+b*acsc(c*x))^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [(d + e*x)^3*(a + b*acsc(c*x)), x, 11, (b*e*(9*c^2*d^2 + e^2)*sqrt(1 - 1/(c^2*x^2))*x)/(6*c^3) + (b*d*e^2*sqrt(1 - 1/(c^2*x^2))*x^2)/(2*c) + (b*e^3*sqrt(1 - 1/(c^2*x^2))*x^3)/(12*c) - (b*d^4*acsc(c*x))/(4*e) + ((d + e*x)^4*(a + b*acsc(c*x)))/(4*e) + (b*d*(2*c^2*d^2 + e^2)*atanh(sqrt(1 - 1/(c^2*x^2))))/(2*c^3)]
    @test_int [(d + e*x)^2*(a + b*acsc(c*x)), x, 10, (b*d*e*sqrt(1 - 1/(c^2*x^2))*x)/c + (b*e^2*sqrt(1 - 1/(c^2*x^2))*x^2)/(6*c) - (b*d^3*acsc(c*x))/(3*e) + ((d + e*x)^3*(a + b*acsc(c*x)))/(3*e) + (b*(6*c^2*d^2 + e^2)*atanh(sqrt(1 - 1/(c^2*x^2))))/(6*c^3)]
    @test_int [(d + e*x)*(a + b*acsc(c*x)), x, 9, (b*e*sqrt(1 - 1/(c^2*x^2))*x)/(2*c) - (b*d^2*acsc(c*x))/(2*e) + ((d + e*x)^2*(a + b*acsc(c*x)))/(2*e) + (b*d*atanh(sqrt(1 - 1/(c^2*x^2))))/c]
    @test_int [a + b*acsc(c*x), x, 5, a*x + b*x*acsc(c*x) + (b*atanh(sqrt(1 - 1/(c^2*x^2))))/c]
    @test_int [(a + b*acsc(c*x))/(d + e*x), x, 4, ((a + b*acsc(c*x))*log(1 - (im*(e - sqrt((-c^2)*d^2 + e^2))*ℯ^(im*acsc(c*x)))/(c*d)))/e + ((a + b*acsc(c*x))*log(1 - (im*(e + sqrt((-c^2)*d^2 + e^2))*ℯ^(im*acsc(c*x)))/(c*d)))/e - ((a + b*acsc(c*x))*log(1 - ℯ^(2*im*acsc(c*x))))/e - (im*b*PolyLog(2, (im*(e - sqrt((-c^2)*d^2 + e^2))*ℯ^(im*acsc(c*x)))/(c*d)))/e - (im*b*PolyLog(2, (im*(e + sqrt((-c^2)*d^2 + e^2))*ℯ^(im*acsc(c*x)))/(c*d)))/e + (im*b*PolyLog(2, ℯ^(2*im*acsc(c*x))))/(2*e)]
    @test_int [(a + b*acsc(c*x))/(d + e*x)^2, x, 7, (b*acsc(c*x))/(d*e) - (a + b*acsc(c*x))/(e*(d + e*x)) + (b*atanh((c^2*d + e/x)/(c*sqrt(c^2*d^2 - e^2)*sqrt(1 - 1/(c^2*x^2)))))/(d*sqrt(c^2*d^2 - e^2))]
    @test_int [(a + b*acsc(c*x))/(d + e*x)^3, x, 8, -(b*c*e*sqrt(1 - 1/(c^2*x^2)))/(2*d*(c^2*d^2 - e^2)*(e + d/x)) + (b*acsc(c*x))/(2*d^2*e) - (a + b*acsc(c*x))/(2*e*(d + e*x)^2) + (b*(2*c^2*d^2 - e^2)*atanh((c^2*d + e/x)/(c*sqrt(c^2*d^2 - e^2)*sqrt(1 - 1/(c^2*x^2)))))/(2*d^2*(c^2*d^2 - e^2)^(3/2))]


    #= ::Subsubsection:: =#
    #=n<0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(d+e*x)^(p/2)*(a+b*acsc(c*x))=#


